    render() { 
        return ( 
            <div className="card text-white bg-success mb-3">
            <div className="card-header">
                Precio del Bitcoin
            </div>
            <div className="card-body">
                <h4 className="card-title">Precio actual: {this.props.PRICE}</h4>
            </div>
        </div>
         );
    }
}
 
export default Precio;
